import React, { useState } from 'react';
import MySettingsIcon from './small-components/MySettingsIcon';
import './NavigationBar.css';

const NavigationBar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const handleMenuClick = () => {
    setIsMenuOpen(!isMenuOpen);
  }

  const handleCloseMenu = () => {
    setIsMenuOpen(false);
  }

  return (
    <div className="navigation-bar" style={{backgroundColor: 'blue', height: '50px', width: '100%', display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '0 20px'}}>
      <div className="logo" style={{fontSize: '24px', fontWeight: 'bold'}}>Logo</div>
      <div className="hamburger-menu-icon" onClick={handleMenuClick} style={{cursor: 'pointer'}}>
        <div className="bar"></div>
        <div className="bar"></div>
        <div className="bar"></div>
      </div>
      {isMenuOpen && (
        <div style={{display: 'flex', alignItems: 'center'}}>
          <div style={{marginRight: '20px'}}>Item 1</div>
          <div style={{marginRight: '20px'}}>Item 2</div>
          <div style={{marginRight: '20px'}}>Item 3</div>
        </div>
      )}
      <MySettingsIcon style={{cursor: 'pointer'}} />
    </div>
  );
};

export default NavigationBar;
